import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <div class="navbar-container">
    <ul class="navbar-list">
      <li class="navbar-item">
        <a href="#">Home</a>
      </li>
      <li class="navbar-item">
        <a href="#">Blog</a>
      </li>
      <li class="navbar-item">
        <a href="#">Experiences/Projects</a>
      </li>
    </ul>
  </div>
  );
}

export default Navbar;
